import { Employee } from "./types"


export const employees = [
  {
    id: "89bd9324-04e0-4cd6-aa27-981508bd219f",
    firstName: "James",
    lastName: "Smith"
  },
  {
    id: "7eeba422-5717-4026-8e74-e517576e26bd",
    firstName: "Mary",
    lastName: "Miller"
  },
  {
    id: "6e88529c-6739-4f1b-bea0-02afdd336bb3",
    firstName: "Linda",
    lastName: "Jones"
  }
];

export const EMPTY_EMPLOYEE: Employee = {
  id: "",
  firstName: "All",
  lastName: "Employees",
};

export const ALL_EMPLOYEES: Employee[] = [
  EMPTY_EMPLOYEE,
  ...employees,
];
